function format_date(pattern) {
	var now = new Date();
	var dd = String(now.getDate()).padStart(2, '0');
	var mm = String(now.getMonth() + 1).padStart(2, '0');
	var yyyy = now.getFullYear();
	
	result = pattern.replace('dd', dd);
	result = result.replace('mm', mm);
	result = result.replace('yyyy', yyyy);
	
	return result;
}

function show_toast(message, type = null) {
	
	if (!type) 
		type = 'success';
	
	background = type = 'success' ? 'bg-success' : 'bg-danger';
	const Toast = Swal.mixin({
				toast: true,
				position: 'top-end',
				showConfirmButton: false,
				timer: 2500,
				timerProgressBar: true,
				iconColor: 'white',
				customClass: {
					popup: background + ' text-light toast p-2'
				},
				didOpen: (toast) => {
					toast.addEventListener('mouseenter', Swal.stopTimer)
					toast.addEventListener('mouseleave', Swal.resumeTimer)
				}
			})
			
	Toast.fire({
		html: '<div class="toast-content d-flex"><i class="far fa-check-circle me-2 mt-1"></i>' + message + '</div>'
	});
}

function generate_tooltip() {
	const tooltipTriggerList = document.querySelectorAll('[data-bs-toggle="tooltip"]')
	const tooltipList = [...tooltipTriggerList].map(tooltipTriggerEl => new bootstrap.Tooltip(tooltipTriggerEl))
}

function showDataTables(options = {}) 
{
	$.extend( $.fn.dataTable.defaults, {
		"language": {
			"processing": '<span><span class="spinner-border text-secondary" role="status"></span></span>',
		}
	});
	
	default_options = {elm: '', queryString: ''}
	$.extend(default_options, options);
	elm = default_options.elm;
	// console.log(elm);
	queryString = default_options.queryString;
	const column = $.parseJSON($(elm + '-dataTables-column').html());
	const url = $(elm + '-dataTables-url').text() + queryString;
	
	settings = {
		"processing": true,
		"serverSide": true,
		"scrollX": true,
		"ajax": {
			"url": url,
			"type": "POST",
		},
		"columns": column,
		"initComplete": function(settings, json) {
		}
	}
	
	let $add_setting = $(elm + '-dataTables-setting');
	if ($add_setting.length > 0) {
		add_setting = $.parseJSON($add_setting.text());
		for (k in add_setting) {
			settings[k] = add_setting[k];
		}
	}
	newDataTables = $(elm).DataTable( settings );
	$(elm + '_processing').addClass('show-datatables-loading');
	return newDataTables;
}

