function is_mobile() {
	return /android|mobile/ig.test(navigator.userAgent);
}

function printStruk(url, $elm = false) 
{
	if ($elm == 'dialog') {
		window.open(url, '', 'toolbar=no,location=no,directories=no,status=no,menubar=no,scrollbars=yes,resizable=yes,width=' + (screen.width) + ',height=' + (screen.height) + ',top=50'+',left=50');
		return;
	}
	
	if (!$elm) {
		$spinner = bootbox.dialog({
			message: '<div class="text-center p-2 fs-5 d-flex justify-content-center"><span class="spinner-border me-3"></span>Mencetak...</div>',
			closeButton: false,
			size: 'small'
		});
	} else {
		$spinner = $('<div class="spinner-border spinner-border-sm me-2"></div>');
		$spinner.prependTo($elm);
		$elm.prop('disabled', true);
	}

	$.ajax({
		url: url,
		success: function(html) {

			if (!$elm) {
				$spinner.modal('hide');
			} else {
				$elm.prop('disabled', false);
				$elm.find('.spinner-border').remove();
			}
			
			is_mobile = /android|mobile/ig.test(navigator.userAgent);
			if (is_mobile) {
				if (direct_printing_mobile == 'Y') {
					window.location.href = "print://escpos.org/escpos/bt/print?srcTp=uri&srcObj=html&src='data:text/html," + html;
				} else {
					window.open(url, '', 'toolbar=no,location=no,directories=no,status=no,menubar=no,scrollbars=yes,resizable=yes,width=' + (screen.width) + ',height=' + (screen.height) + ',top=50'+',left=50');
						return;
				}
			} else {
				if (direct_printing_desktop == 'Y') {
					qz.websocket.connect().then(() => {
						return qz.printers.getDefault();
					}).then((found) => {
						
						config = qz.configs.create(found);
						data = [{
							type: 'pixel',
							format: 'html',
							flavor: 'plain',
							data: html
						}];
						return qz.print(config, data);
							
					}).catch((e) => {
						console.log(e);
						bootbox.alert(e);
						qz.websocket.disconnect();
					}).finally(() => {
						return qz.websocket.disconnect();
					});
				} else {
					window.open(url, '', 'toolbar=no,location=no,directories=no,status=no,menubar=no,scrollbars=yes,resizable=yes,width=' + (screen.width) + ',height=' + (screen.height) + ',top=50'+',left=50');
					return;
				}
			}
		}, error: function(xhr) {
			console.log(xhr);
			if (!$elm) {
				$spinner.modal('hide');
			} else {
				$elm.prop('disabled', false);
				$elm.find('.spinner-border').remove();
			}
			alert_icon(xhr);
		}
	})
}